import React from 'react';


const Location = ({ showModal, handleModalClose , setLocation }) => {

  const handleChangeLocation = (lat , long) => {
    setLocation({lat , long})
    handleModalClose();
  };

  return (
    <div>
      {showModal && (
        <div className="modal" tabIndex="-1" role="dialog" style={{ display: 'block' }}>
          <div className="modal-dialog" role="document">
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title">Choose Location</h5>
                <button type="button" className="btn-close" aria-label="Close" onClick={handleModalClose}></button>
              </div>
              <div className="modal-body" style={{ maxHeight: "150px", overflowY: "scroll" }}>
                <form>
                    <div className="mb-3">
                        <label className="form-label">Select Location</label>
                        <div className="form-check">
                            <input className="form-check-input" type="radio"
                            onChange = {()=>{
                              setLocation({
                                lat : ""
                              })
                              console.log(`Lat = 17.4375084 Long = 78.4482441`)}}
                            name="location" id="madhapur" value="Madhapur" />
                            <label className="form-check-label" htmlFor="madhapur">Madhapur</label>
                        </div>
                        <div className="form-check">
                            <input className="form-check-input" type="radio" 
                            onChange = {()=>{console.log(`Lat = 17.492838 Long = 78.54690149999999`)}}
                            name="location" id="sainikpuri" value="Sainikpuri" />
                            <label className="form-check-label" htmlFor="sainikpuri">Sainikpuri</label>
                        </div>
                        <div className="form-check">
                            <input className="form-check-input" type="radio" name="location" id="gachibowli" value="Gachibowli" />
                            <label className="form-check-label" htmlFor="gachibowli">Gachibowli</label>
                        </div>
                        <div className="form-check">
                            <input className="form-check-input" type="radio" name="location" id="kondapur" value="Kondapur" />
                            <label className="form-check-label" htmlFor="kondapur">Kondapur</label>
                        </div>
                    </div>
                    <button className="btn btn-primary mt-2" id="searchres" type="button" onClick={handleChangeLocation}>Change Location</button>
                </form>
            </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}

export default Location;
